@EU_Commission @vonderleyen "Phasing out Russian oil"

In other words, still F-ALL.
Bankrolling Putin for a longer time.

@EU_Commission @vonderleyen Re: "De-swifting major russian banks" 

Replace the word "major" with "all".
All of them should be disconnected from SWIFT.

@EU_Commission Now all (!!) @EC_Commission has to do is:
* get rid of the business #lobby groups that dominate policies;
* weld the revolving door firmly shut;
* forbid #donations from business over a certain amount;
Then we'd maybe have an EC Commission for the people.
